INSERT INTO [dbo].[t_an_ques_type] ([ques_type_id], [ques_type_name], [ques_type_english_name], [ques_type_remarks], [ques_survey_id], [order_by_id], [is_background_survey], [is_delete], [create_time], [update_time]) VALUES (42, '背景资料', 'Background Information', '首先，我们希望能更进一步地了解您。请不用担心，所有资料都将被保密。这些资料只是用来帮助我们分析以及解释问卷 结果。请在方格中勾选下列合适的选项。    	\n	Firstly, we''d like to know more about you. Don''t worry, all information will be kept competely confidential and will not be released to your employer. The information will just be used for analyzing the results.', 1536647459940, 1, 1, 0, '2018-11-7 22:48:55', '2018-11-7 22:48:55');
